description:
A reproduction of the IRM Regiorunner electric passenger train that can be seen all over the Nederlandse Spoorwegen (Dutch national railways) network. This model includes the original DD-IRM as well as the new V-IRM versions.

Can be used in your own scenarios, and is available in Train Simulator 2013 QuickDrive.

Please support the developers and buy some of their content if you can afford it.

